import React from 'react';
import './globall.css'
import './layout.css'


function NavBar() {
    return (
        <nav class="navbar">
        <div class="container">
        <a href="#">Hulk</a>
        <a href="#" class="logo is-active">Mavel</a>
        <a href="#">Venom</a>
      </div>
    </nav>
    )
}

export default NavBar;
